//페이지들의 공통되는 것들을 처리할 수 있다.
import React from 'react'
import PropTypes from 'prop-types'
import 'antd/dist/antd.css'

const App = ({Component}) => {
  return <Component>
    </Component>
}
App.propTypes = {
  Component : PropTypes.elementType.isRequired
}

export default App;
